import React from "react";

function ChatModal() {
  return (
    <div className="modal">
      <div className="insideModal">
        <div className="messages"></div>
        <div className="sending">
          <input type="text" placeholder="message" />
          <button>Send</button>
        </div>
      </div>
    </div>
  );
}

export default ChatModal;
